import { ImageResponse } from 'next/og';

export const runtime = 'edge';

export const alt = 'Mumin Reader - Authentic Hadiths';
export const size = {
    width: 1200,
    height: 630,
};
export const contentType = 'image/png';

// Убери generateImageMetadata совсем!
// Вместо этого просто принимай params

export default async function Image(props: { params: Promise<{ locale: string }> }) {
    const { locale } = await props.params;
    const emerald950 = '#022c22';
    const emerald900 = '#064e3b';
    const emerald800 = '#065f46';
    const gold500 = '#d4af37';
    const gold400 = '#fbbf24';
    const cream = '#fffdf9';

    const logoSrc = 'data:image/svg+xml;base64,';

    return new ImageResponse(
        (
            <div
                style={{
                    height: '100%',
                    width: '100%',
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    justifyContent: 'center',
                    backgroundColor: emerald950,
                    position: 'relative',
                    overflow: 'hidden',
                }}
            >
                {/* весь твой остальной JSX */}
                {/* Background with rich radial gradient */}
                <div
                    style={{
                        position: 'absolute',
                        top: 0,
                        left: 0,
                        right: 0,
                        bottom: 0,
                        background: `radial-gradient(circle at center, ${emerald900} 0%, ${emerald950} 100%)`,
                        display: 'flex',
                    }}
                />

                {/* Decorative Islamic Geometric Patterns (Corners) */}
                {[0, 1, 2, 3].map((i) => (
                    <div
                        key={i}
                        style={{
                            position: 'absolute',
                            width: '400px',
                            height: '400px',
                            opacity: 0.1,
                            border: `2px solid ${gold500}`,
                            transform: `rotate(${i * 22.5}deg) scale(1.2)`,
                            top: i < 2 ? '-200px' : 'auto',
                            bottom: i >= 2 ? '-200px' : 'auto',
                            left: i % 2 === 0 ? '-200px' : 'auto',
                            right: i % 2 !== 0 ? '-200px' : 'auto',
                            display: 'flex',
                        }}
                    />
                ))}

                {/* Outer decorative borders */}
                <div
                    style={{
                        position: 'absolute',
                        top: '40px',
                        left: '40px',
                        right: '40px',
                        bottom: '40px',
                        border: `1px solid ${gold500}`,
                        opacity: 0.4,
                        display: 'flex',
                    }}
                />
                <div
                    style={{
                        position: 'absolute',
                        top: '55px',
                        left: '55px',
                        right: '55px',
                        bottom: '55px',
                        border: `3px solid ${gold500}`,
                        opacity: 0.2,
                        display: 'flex',
                    }}
                />

                {/* Main Content Container */}
                <div
                    style={{
                        display: 'flex',
                        flexDirection: 'column',
                        alignItems: 'center',
                        justifyContent: 'center',
                        zIndex: '10',
                    }}
                >
                    {/* Logo with subtle glow */}
                    <div style={{
                        display: 'flex',
                        padding: '20px',
                        backgroundColor: 'rgba(212,175,55,0.05)',
                        borderRadius: '50%',
                        marginBottom: '40px',
                        border: `1px solid ${gold500}`,
                    }}>
                        <img
                            src={logoSrc}
                            width="140"
                            height="140"
                            alt="Logo"
                        />
                    </div>

                    {/* App Name with Premium Typography */}
                    <div
                        style={{
                            display: 'flex',
                            flexDirection: 'column',
                            alignItems: 'center',
                        }}
                    >
                        <div
                            style={{
                                color: gold500,
                                fontSize: '88px',
                                fontWeight: 900,
                                letterSpacing: '-0.02em',
                                marginBottom: '10px',
                                textShadow: '0 4px 15px rgba(0,0,0,0.4)',
                            }}
                        >
                            Mumin Reader
                        </div>

                        {/* Decorative Divider */}
                        <div style={{
                            display: 'flex',
                            alignItems: 'center',
                            width: '100%',
                            gap: '20px',
                            margin: '10px 0',
                        }}>
                            <div style={{ flex: 1, height: '1px', background: `linear-gradient(to right, transparent, ${gold500})` }} />
                            <div style={{ color: gold400, fontSize: '32px' }}>✦</div>
                            <div style={{ flex: 1, height: '1px', background: `linear-gradient(to left, transparent, ${gold500})` }} />
                        </div>

                        <div
                            style={{
                                color: cream,
                                fontSize: '28px',
                                fontWeight: 500,
                                letterSpacing: '0.4em',
                                textTransform: 'uppercase',
                                opacity: 0.9,
                                marginTop: '10px',
                            }}
                        >
                            Authentic Prophetic Wisdom
                        </div>
                    </div>

                    {/* Subdomain Branding */}
                    <div style={{
                        position: 'absolute',
                        bottom: '-120px',
                        color: gold400,
                        fontSize: '20px',
                        opacity: 0.6,
                        letterSpacing: '0.1em',
                        display: 'flex',
                    }}>
                        hadith.mumin.ink
                    </div>
                </div>
            </div>
        ),
        {
            ...size,
        }
    );
}